              <div class="stl_01" style="top: 0.5991em; left:14.0917em;"><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">西门子 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">PLC</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">以太网连接的 </span><span class="stl_10 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">IP</span><span class="stl_07 stl_08 stl_09" style="font-weight:bold; word-spacing:-0.0829em;">地址设定 &nbsp;</span></div>
              <div class="stl_01" style="top: 3.3271em; left:7.502em;"><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0466em;">西门子 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0466em;">PLC</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0466em;">与 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0466em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0466em;">通过以太网连接时，必须通过 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0466em;">setp7smart</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0466em;">软件设置成与 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0466em;">SS700</span><span class="stl_11 stl_12 stl_13" style="word-spacing:-0.0466em;">同网段的 </span><span class="stl_14 stl_12 stl_13" style="word-spacing:-0.0466em;">IP &nbsp;</span></div>
              <div class="stl_01" style="top: 4.8171em; left:5.752em;"><span class="stl_11 stl_12 stl_15">地址。 &nbsp;</span></div>
              <div class="stl_01" style="top: 6.8171em; left:7.502em;"><span class="stl_11 stl_12 stl_16">在设置之前要确保要进行设置的</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0167em;">&nbsp;</span><span class="stl_14 stl_12 stl_16" style="word-spacing:-0.0167em;">PLC</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0167em;">处于运行状态，</span><span class="stl_11 stl_12 stl_16" style="word-spacing:0.233em;">&nbsp;让</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0283em;">&nbsp;</span><span class="stl_14 stl_12 stl_16" style="word-spacing:-0.0283em;">PLC</span><span class="stl_11 stl_12 stl_16" style="word-spacing:-0.0283em;">与电脑连接，设置步骤如下： &nbsp;</span></div>
              <div class="stl_01" style="top: 8.8088em; left:7.502em;z-index:156; "><span class="stl_11 stl_12 stl_17">＊第一步：电脑与</span><span class="stl_11 stl_12 stl_17" style="word-spacing:0.1123em;">&nbsp;</span><span class="stl_14 stl_12 stl_17" style="word-spacing:0.1123em;">PLC</span><span class="stl_14 stl_12 stl_17" style="word-spacing:-0.1462em;">&nbsp;</span><span class="stl_11 stl_12 stl_17" style="word-spacing:-0.1462em;">连接成功后，打开</span><span class="stl_11 stl_12 stl_17" style="word-spacing:0.1127em;">&nbsp;</span><span class="stl_14 stl_12 stl_17" style="word-spacing:0.1127em;">setp7</span><span class="stl_14 stl_12 stl_17" style="word-spacing:0.0104em;">&nbsp;smart</span><span class="stl_14 stl_12 stl_17" style="word-spacing:0.0112em;">&nbsp;</span><span class="stl_11 stl_12 stl_17" style="word-spacing:0.0112em;">软件，</span><span class="stl_11 stl_12 stl_17" style="word-spacing:0.2487em;">&nbsp;找到左侧的“系统块</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.2614em;">&nbsp;</span><span class="stl_11 stl_12 stl_18">”，</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.2386em;">&nbsp;</span><span class="stl_11 stl_12 stl_15">并 &nbsp;</span></div>
              <div class="stl_01" style="top: 10.3088em; left:7.502em;"><span class="stl_11 stl_12 stl_15">双击。 &nbsp;</span></div>
              <div class="stl_01" style="top: 32.2113em; left:7.482em;z-index:186; "><span class="stl_11 stl_12 stl_19">※第二步</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_20">：双</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.2621em;">&nbsp;</span><span class="stl_11 stl_12 stl_21" style="word-spacing:-0.0938em;">击后在如下出现对话框设定 </span><span class="stl_14 stl_12 stl_21" style="word-spacing:-0.0938em;">IP</span><span class="stl_11 stl_12 stl_21" style="word-spacing:-0.0938em;">地址</span><span class="stl_11 stl_12 stl_15" style="word-spacing:-0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_22">，由</span><span class="stl_11 stl_12 stl_15" style="word-spacing:0.25em;">&nbsp;</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0877em;">于 </span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0877em;">SS700</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0877em;">的默认网关为 </span><span class="stl_14 stl_12 stl_23" style="word-spacing:-0.0877em;">192.168.200.1</span><span class="stl_11 stl_12 stl_23" style="word-spacing:-0.0877em;">， &nbsp;</span></div>
              <div class="stl_01" style="top: 33.5113em; left:5.732em;"><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0197em;">小编把该 </span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.0197em;">PLC</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0197em;">的 </span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.0197em;">IP</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0197em;">地址设为：</span><span class="stl_14 stl_12 stl_24" style="word-spacing:-0.0197em;">192.168.200.5</span><span class="stl_11 stl_12 stl_24" style="word-spacing:-0.0197em;">，最后点击“确定”。 &nbsp;</span></div>
